const Authentication = {
    isAuthenticated: false,
    userName: '',
    // setUserName(name){
    //     this.userName = name
    // }
    authenticate(cb) {
        this.isAuthenticated = true
        setTimeout(cb, 100)
    },
    signout(cb) {
        this.isAuthenticated = false
        setTimeout(cb, 100)
    }
}
export default Authentication;
